insert into client_messagetranslation values (3015,'AIR','<p>?Olu?olu e nana hou i kau mau ha?ina ma mua o ka ho?omau ?ana i ka ho?ike.Hiki ?ole ana ia?oe ke ho?i hou mai i keia mau ninau nei ma hope iho. </p><p>Kaomi aku ma ka ?ao?ao hema o ka helu o kekahi ninau au e makemake nei e nana hou ?ia.</p>','HAW','--ANY--','--ANY--',UNHEX(REPLACE('6F651269-0E76-402F-919F-CF273C95B56C','-','')),'2013-12-18 14:09:06.840');
insert into client_messagetranslation values (2497,'AIR','<div class="blurb"><p>Aloha mai kākou! Eia kahi o ka Ho‘oma‘ama‘a Hō‘ike. Hiki iā ‘oe ke ho‘ohana i kēia wahi no ka ho‘oma‘ama‘a ‘ana i nā hō‘ike HSA pūnaewele. No kekahi mau nīnau, e pono ana ‘oe e koho i kekahip pane; no nā nīnau ‘ē a‘e, pono paha ‘oe e kikokiko i pane pōkole, kahaki‘i i ki‘i a i ‘ole e ho‘okō ana ‘oe i kekahi hana ‘ē a‘e.<a href="http://www.alohahsa.org/answerKeys.html" target="_self" class="linkbox">E kaomi i ‘ane‘i no ke Kī Pane no ka Hō‘ike Ho‘oma‘ama‘a.</a></p></div>  <div class="blurb"><p><a href="https://hsapt.tds.airast.org/grid/default.aspx?showLangSelect=true" target="_self" target="_self" class="gridlink">E kaomi i ‘ane‘i no ke a‘o ‘ana mai i ka pane ‘ana i nā nīnau ‘enehana ki‘i.</a></p></div>    <div class="blurb"><p>Pono ‘oe e ho‘ohana i ka Mozilla Firefox no ka ho‘okuene ‘ikepili no ke komo ‘ana ma ka Hō‘ike Ho‘oma‘ama‘a. ‘A‘ole hana ka Explorer a me ka Safari no kēia wahi. <a href="http://www.mozilla.com/en-US/firefox/all-older.html" target="_self" class="linkbox"> E kaomi i ‘ane‘i no ka ho‘oili ‘ana i ka Firefox no ka Windows, ka Mac OS X a me ka Linux.</a><br />  No ka ho‘ohana ‘ana i ke Kuapo-Kākau-Me-Ka-Leo, pono ‘oe e ho‘ohana i ka ho‘okuena ‘ike no ka ho‘omaka ‘ana i ka hō‘ike ho‘oma‘ama‘a.</p></p></div>','HAW','--ANY--','--ANY--',UNHEX(REPLACE('D617CADF-23ED-439B-96FC-CF312EEFA4F5','-','')),'2013-08-01 11:02:31.780');
