insert into client_messagetranslation values (3333,'AIR','<h2>Na ka?ao</h2><p><strong>Ka lo?ihi</strong> a ke kahua e lawe ai no ke kukulu ?ana i kekahi noi.</p><p>Ka lo?ihi a ka polokalamu <strong>punaewele e lawe ai</strong> no ke kukulu ?ana i ka noi ?ana no kekahi pu?ulu ?ikemu mai na koho ho?oma?a alokima (algorithm) (komo pu na ho?opa?alua/ho?okala pa?alua a pau)</p><p>Ka lo?ihi a ka polokalamu <strong>punaewele e lawe ai no ka noi</strong> i noi mua ?ia no na koho pu?ulu ?ikemu no ka nana hou ?ana (me na SSL)</p><p>Ka lo?ihi a ka polokalamu <strong>kikowaena punaewele e lawe ai no ka ho?opau ?ana</strong> i na noi o na koho ?ikemu. (?A?ole komo pu na ho?opa?alua/Ho?okala pa?alua o SSL)</p><p>Ka lo?ihi a ka polokalamu <strong> kikowaena punaewele e lawe ai no</strong> ka noi i noi mua ?ia no na koho pu?ulu ?ikemu no ka nana hou ?ana (me ka loa?a ?ole o na SSL)</p><p>Na manawa ma ka <strong>li?ili?i loa, ka nui loa</strong> a me ka manawa (i na hapa kaukani kekona) like no ke kukulu ?ana i kekahi noi </p><p><strong>dbmin/dbmax/dbmean</strong> Ka manawa a ke kahua e lawe ai no ka manawa holo?oko?a e lilo ai i ke kukulu ?ana i ka ?ikepili ho?ike ho?ohaku </p>','HAW','--ANY--','--ANY--',UNHEX(REPLACE('10DF0A2F-DAB8-4F3F-9ED8-EDBBBB08C21C','-','')),'2013-12-18 14:09:07.140');
