insert into client_messagetranslation values (3345,'SBAC','<p>Type in a full, valid State-SSID and click [Look Up Student] to access an individual student''s personal information, including enrolled grade level, birth date and associated school and district. Note: Partial searches are not allowed.</p><br/><p>Note: This Student Lookup feature allows you to verify student information for login purposes only. It does not indicate whether a student is eligible to test. To verify student eligibility for a specific online assessment, please check TIDE.</p>','ENU','--ANY--','--ANY--',UNHEX(REPLACE('D376F27F-8ACF-498A-9207-B3C61629EBBB','-','')),'2013-08-01 14:17:09.583');
insert into client_messagetranslation values (3231,'SBAC','<h2>Smarter Balanced Assessments Secure Test Material</h2>  <br />  <p><strong>This printout contains secure test content and must be immediately and securely recycled on-site by authorized school staff.</strong></p><p>Do not photocopy, enlarge, digitize, or retain printouts of test content. Such actions constitute a severe test security violation and must be reported to Smarter Balanced.</p><p>In accordance with the Family Educational Rights and Privacy Act (FERPA), disclosure of personally identifiable information protected by privacy laws is prohibited. Please securely destroy all printed test content immediately after the end of this testing session.</p>','ENU','--ANY--','--ANY--',UNHEX(REPLACE('EA5A47FE-BF27-49EB-94BC-B2678D14FA80','-','')),'2013-08-01 14:17:09.583');
