insert into client_messagetranslation values (3637,'SBAC','<p>This page allows you to check the <strong>current</strong> bandwidth of your network. The following operating systems and web browsers are supported: </p>  <ul>  <li>Windows XP, Vista, 7, 8.0, 8.1: Mozilla Firefox</li>  <li>Mac OS 10.4.4&#8211;10.9: Firefox</li>  <li>Linux Fedora Core 6 or 16; Ubuntu 9&#8211;11.10: Firefox</li>    <li>Apple tablets (iPad) running iOS 6.0-7.0: Safari</li>  <li>Android tablets running 4.0.4-4.2: Google Chrome</li> <li>Chromeos 31+: Google Chrome</li> </ul>       <p>To determine your bandwidth, select a test from the drop-down list and enter the maximum number of students likely to test at one time, then click [Run Network Diagnostics Tests].  </p>     <p>The [<strong>Text-to-Speech Check</strong>] is for schools who will be administering the Field test and requires the use of the secure browser. The secure browser is available from <a target="_blank" href="http://sbac.portal.airast.org">http://sbac.portal.airast.org</a>.  </p>','ENU','--ANY--','--ANY--',UNHEX(REPLACE('E8B5DCD6-CF66-4369-AD96-0927168408C1','-','')),'2014-03-11 12:35:15.630');
